import React from 'react';
import * as ReactBootStrap from "react-bootstrap";
import Header from './Header';
import TopBar from './TopBar';


function HomePage() {
    return (
     
      <React.Fragment>
     
          <div >
          <TopBar/>
          <Header/>
          
          
          <h1>Pocetna stranica</h1>
        
          </div>

      </React.Fragment>
    );
  }
  
  export default HomePage;
